import React from 'react';

const Home = () => {
    return (
        <section id="home" className="home">
            <div class="align-self-center">
                <h2 class="mb-1x">I'm Kyle Geary</h2>
                <h2> I'm a full-stack developer  a self-driven learner and having a knack for problem-solving, I always welcome new challenges to help expand my current skills.</h2>
            </div>
        </section>
    );
};

export default Home;
